"  <div id=\"topicText\">",
"   <p class=\"headingAnchor\" id=\"H25721383\">",
"    <span class=\"h1\">",
"     What is coronary heart disease?",
"    </span>",
"    &nbsp;&mdash;&nbsp;Coronary heart disease is a condition that puts you at risk for heart attack and other forms of heart disease. In people who have coronary heart disease, the arteries that supply blood to the heart get clogged with fatty deposits (",
"    <a class=\"graphic graphic_figure graphicRef61785 \" href=\"UTD.htm?8/10/8356\">",
"     figure 1",
"    </a>",
"    ). Other names for this disease are &ldquo;coronary artery disease&rdquo; or just &ldquo;heart disease.&rdquo;",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H25721390\">",
"    <span class=\"h1\">",
"     What are the symptoms of coronary heart disease?",
"    </span>",
"    &nbsp;&mdash;&nbsp;Most people with coronary heart disease have no symptoms. In fact, the first symptom of the disease can be a heart attack (",
"    <a class=\"graphic graphic_figure graphicRef52579 \" href=\"UTD.htm?1/15/1268\">",
"     figure 2",
"    </a>",
"    ). That&rsquo;s why it is so important to know how to spot a heart attack.",
"   </p>",
"   <p>",
"    The symptoms of a heart attack can include:",
"   </p>",
"   <p>",
"    <ul class=\"bulletCompact-block\">",
"     <li>",
"      Pain, pressure, or discomfort in the center of the chest",
"     </li>",
"     <li>",
"      Pain, tingling, or discomfort in other parts of the upper body, including the arms, back, neck, jaw, or stomach",
"     </li>",
"     <li>",
"      Shortness of breath",
"     </li>",
"     <li>",
"      Nausea, vomiting, burping, or heartburn",
"     </li>",
"     <li>",
"      Sweating or having cold, clammy skin",
"     </li>",
"     <li>",
"      A racing or uneven heartbeat",
"     </li>",
"     <li>",
"      Feeling dizzy or lightheaded",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    If these symptoms last more than 10 minutes or they keep coming and going, call 9-1-1 for an ambulance right away. Do not try to get to the hospital on your own.",
"   </p>",
"   <p>",
"    Some people with coronary heart disease have chest pain even when they are not having a heart attack. This is most likely to happen when they are walking, going up stairs, or moving around. But if you have chest pain that is new or different than pain you have had before, you should see a doctor right away. &nbsp;",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H25721397\">",
"    <span class=\"h1\">",
"     Is there a test for coronary heart disease?",
"    </span>",
"    &nbsp;&mdash;&nbsp;Yes. If your doctor or nurse thinks you might have coronary heart disease, he or she might order blood tests and one or more of these tests:",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      <strong>",
"       An electrocardiogram (&ldquo;ECG&rdquo; or &ldquo;EKG&rdquo;)",
"      </strong>",
"      &ndash; This test measures the electrical activity in your heart.",
"     </li>",
"     <li>",
"      <strong>",
"       A stress test",
"      </strong>",
"      &ndash; During a stress test, you might be asked to run or walk on a treadmill while you also have an ECG. Physical activity increases the heart&rsquo;s need for blood. This test helps doctors see if the heart is getting enough blood. If you cannot walk or run, your doctor might do this test by giving you a medicine to make your heart pump faster.",
"     </li>",
"     <li>",
"      <strong>",
"       An echocardiogram",
"      </strong>",
"      &ndash; This test uses sound waves to create an image of your heart as it beats.",
"     </li>",
"     <li>",
"      <strong>",
"       Cardiac catheterization",
"      </strong>",
"      &ndash; Cardiac (heart) catheterization is also known as cardiac &ldquo;cath&rdquo; or coronary angiography. During this test the doctor inserts a thin tube into a blood vessel in your leg or arm and threads it up to your heart. Then the doctor injects a dye that shows up on an x-ray. This dye can show whether any of the arteries in your heart are clogged.",
"     </li>",
"    </ul>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H25721404\">",
"    <span class=\"h1\">",
"     How is coronary heart disease treated?",
"    </span>",
"    &nbsp;&mdash;&nbsp;The main treatments for coronary heart disease are:",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      <strong>",
"       Lifestyle changes",
"      </strong>",
"      &ndash; You can reduce your risk of heart attack and death by:",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    <ul class=\"hyphen-block\">",
"     <li>",
"      Quitting smoking, if you smoke.",
"     </li>",
"     <li>",
"      Eating lots of fruits and vegetables and low-fat dairy products, but not a lot of meat or fatty foods.",
"     </li>",
"     <li>",
"      Walking or doing some form of physically activity on most days of the week.",
"     </li>",
"     <li>",
"      Losing weight, if you are overweight.",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      <strong>",
"       Medicines",
"      </strong>",
"      &ndash; The medicines to treat heart disease are very important. Some medicines lower your risk of heart attacks and can help you live longer. But you must take them every day, as directed. Medicines your doctor might prescribe include:",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    <ul class=\"hyphen-block\">",
"     <li>",
"      Medicines called statins, which lower cholesterol",
"     </li>",
"     <li>",
"      Medicines to lower blood pressure",
"     </li>",
"     <li>",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?6/12/6342?source=see_link\">",
"       Aspirin",
"      </a>",
"      or other medicines that help prevent blood clots",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    People who have chest pain caused by coronary heart disease (called &ldquo;angina&rdquo;) can also get medicines to relive their pain. These medicines might include &ldquo;nitrates,&rdquo; &ldquo;beta blockers,&rdquo; and others. &nbsp; &nbsp;",
"   </p>",
"   <p>",
"    Some people with coronary heart disease can also have:",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      <strong>",
"       Angioplasty",
"      </strong>",
"      (also known as &ldquo;stenting&rdquo;) &ndash; During angioplasty, a doctor puts a thin tube into a blood vessel in the leg or arm and threads it up to the heart. Then the doctor inflates a tiny balloon inside the clogged artery to reopen it. Often the doctor props open the artery using a tiny mesh tube called a stent.",
"     </li>",
"     <li>",
"      <strong>",
"       Bypass surgery",
"      </strong>",
"      (also known as &ldquo;coronary artery bypass grafting&rdquo;) &ndash; During bypass surgery, the doctor removes a piece of blood vessel from another part of the body. Then he or she reattaches the blood vessel above and below the area that is clogged. This re-routes blood around the clog, and allows it to get to the part of the heart that was not getting blood (",
"      <a class=\"graphic graphic_figure graphicRef73589 \" href=\"UTD.htm?37/7/38004\">",
"       figure 3",
"      </a>",
"      ).",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    If your doctor recommends angioplasty or bypass surgery, ask these questions:",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      What are the benefits of this procedure for me? Will the procedure help me live longer? Will it reduce my chance of having a heart attack? Will I feel better if I have this procedure?",
"     </li>",
"     <li>",
"      What are the risks of the procedure?",
"     </li>",
"     <li>",
"      What happens if I don&rsquo;t have this procedure?",
"     </li>",
"    </ul>",
"   </p>",
